import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Liste from './Liste';
import Maj from './Maj';
import Recherche from './Recherche';
import FiltreVille from './FiltreVille';
import NotFound from './Vide';
export default function App() {
    const [clients, setClients] = useState([]);
    return (
        <Router>
            <Navbar />
            <div className="container mt-4">
                <Routes>
                    <Route path="/" element={<Maj clients={clients} setDepenses={setClients} />} />
                    <Route path="/liste" element={<Liste clients={clients} />} />
                    <Route path="/recherche" element={<Recherche clients={clients}/>} />
                    <Route path="/filtreVille" element={<FiltreVille clients={clients}/>} />
                    <Route path="*" element={<NotFound />} />
                </Routes>
            </div>
        </Router>
    );
}
function Navbar() {
    return (
        <nav className="navbar navbar-dark bg-dark">
            <div className="container-fluid">
                <div className="d-flex justify-content-start">
                    <Link className="navbar-brand me-3" to="/">Gestion des clients</Link>
                    <Link className="nav-link me-3" to="/liste">Liste</Link>
                    <Link className="nav-link me-3" to="/recherche">Recherche</Link>
                    <Link className="nav-link me-3" to="/filtreVille">Filtrer par ville</Link>
                
                </div>
            </div>
        </nav>
    );
}
